import "./FrameComponent3.css";

const FrameComponent3 = () => {
  return (
    <section className="output-port-parent">
      <div className="output-port" />
      <img className="wave-3-1-icon" loading="lazy" alt="" src="/wave3-1.svg" />
    </section>
  );
};

export default FrameComponent3;
